from __future__ import print_function
import matplotlib.pyplot as plt
import skimage.io
from skimage.segmentation import felzenszwalb, slic, quickshift
from skimage.segmentation import mark_boundaries
from skimage.util import img_as_float
from libtiff import TIFF
import base64

import geopandas as gpd


text_base64 =""

bytes_base64 = text_base64.encode()
data = base64.b64decode(bytes_base64)
open(r"C:/Temp/generate_tiff.tiff", 'wb').write(data)

# to open a tiff file for reading:
tif = TIFF.open(r"C:/Temp/generate_tiff.tiff", mode='r')
# to read an image in the currect TIFF directory and return it as numpy array:
image = tif.read_image()

#img = skimage.io.imread('./m_4111722_ne_11_1_20100704.tif')

res1 = skimage.segmentation.felzenszwalb(image, scale=50)
res2 = skimage.segmentation.felzenszwalb(image, scale=600)

#printing the results
fig = plt.figure(figsize=(12, 5))
ax1 = fig.add_subplot(121)
ax2 = fig.add_subplot(122)
ax1.imshow(res1); ax1.set_xlabel("k=50")
ax2.imshow(res2); ax2.set_xlabel("k=600")
fig.suptitle("Graph based image segmentation")
plt.tight_layout()

plt.show()
